import React from "react";
import logo from './logo.svg';
import './App.css';
import axios from "axios";

function App() {
  const [readMarbledata, setreadMarbleData] = React.useState('');
  const [marbleName, setmarbleName] = React.useState('');

  const [deleteMarbledata, setdeleteMarbleData] = React.useState('');
  const [deletemarbleName, setdeletemarbleName] = React.useState('');



  const [readMarblePrivateDetailsdata, setreadMarblePrivateDetailsData] = React.useState('');


  const [getMarblesByRangedata, setgetMarblesByRangeData] = React.useState('');
  const [marbleNameRange1, setmarbleNameRange1] = React.useState('');
  const [marbleNameRange2, setmarbleNameRange2] = React.useState(''); 

  const [initMarbleformData, setinitMarbleFormData] = React.useState({});
  const [initMarbleResponse, setinitMarbleResponse] = React.useState('');

 /*---------------------------------------------------------------------*/   
    const getreadMarble = () => {
    fetch(`/api/readMarble/${marbleName}`)
      .then((res) => res.json())
      .then((data) => {
      var responseData = data.response;
        delete responseData.name;
        delete responseData.docType;
        setreadMarbleData((responseData));
/*      delete data.response['docType'];
      delete data.response['name'];
      setreadMarbleData(data.response); */
      });
  };


    const getdeleteMarble = async () => {
        try {
            const encodedMarble = btoa(JSON.stringify({ name: deletemarbleName }));
            const response = await axios.post('/api/deleteMarble/', { marble_delete: encodedMarble });
            setdeleteMarbleData(response.data);
        } catch (error) {
            console.error('Error deleting marble:', error);
            setdeleteMarbleData('Error deleting marble');
        }
    };

    const getreadMarblePrivateDetails = () => {
    fetch(`/api/readMarblePrivateDetails/${marbleName}`)
      .then((res) => res.json())
      .then((data) => setreadMarblePrivateDetailsData(data.response));
  };

  const getMarblesByRange = () => {
    fetch(`/api/getMarblesByRange/${marbleNameRange1}/${marbleNameRange2}`)
      .then((res) => res.json())
      .then((data) => setgetMarblesByRangeData(data.response));
  };


  const handleFormChange = (e) => {
    const { name, value } = e.target;
    setinitMarbleFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const initMarble = (e) => {
    e.preventDefault();
    // Make API request to your Node.js server with formData in the request body
    axios.post('/api/initMarble', initMarbleformData)
      .then(response => {
        // Set the response in state
        setinitMarbleResponse(response.data);
        setinitMarbleFormData({});
      })
      .catch(error => {
        // Handle error
        console.error('Error:', error);
        // Clear responseText state in case of error
        setinitMarbleResponse('');
      });
  };


  return (
    <div className="App">
      <header className="App-header">

/* ------------------------------------------------------------------ */   

    <div>

        <input
        type="text"
        value={marbleName}
        onChange={e => setmarbleName(e.target.value)}
      />

      <button onClick={getreadMarble}>readMarble</button>
      <button onClick={getreadMarblePrivateDetails}>readMarblePrivateDetails</button>

        {readMarbledata && (
        <div style={{ maxWidth: '500px', overflowWrap: 'break-word' }}>
          <p>Response: {readMarbledata}</p>
        </div>
      )}

        <div style={{ display: 'flex', justifyContent: 'center' }}>
  <div style={{ maxWidth: '500px', overflowWrap: 'break-word' }}>
    <button style={{ backgroundColor: 'green', color: 'white', padding: '10px', border: 'none', borderRadius: '5px' }}>Response: {readMarblePrivateDetailsdata}</button>
  </div>
</div>

    </div>

 /* ------------------------------------------------------------------ */

      <input
        type="text"
        value={marbleNameRange1}
        onChange={e => setmarbleNameRange1(e.target.value)}
      />

      <input
        type="text"
        value={marbleNameRange2}
        onChange={e => setmarbleNameRange2(e.target.value)}
      />

      <button onClick={getMarblesByRange}>getMarblesByRange</button>

        {getMarblesByRangedata && (
        <div style={{ maxWidth: '500px', overflowWrap: 'break-word' }}>
          <p>Response: {getMarblesByRangedata}</p>
        </div>
      )}  
/*---------------------------------------------------------------------*/

      <form onSubmit={initMarble}>
        <label>
          name:
          <input type="text" name="name" value={initMarbleformData.name || ''} onChange={handleFormChange} />
        </label>
        <label>
          city:
          <input type="text" name="city" value={initMarbleformData.city || ''} onChange={handleFormChange} />
        </label>
        <label>
          dob:
          <input type="text" name="dob" value={initMarbleformData.dob || ''} onChange={handleFormChange} />
        </label>
        <label>
          age:
          <input type="text" name="age" value={initMarbleformData.age || ''} onChange={handleFormChange} />
        </label>
        <label>
          postcode:
          <input type="text" name="postcode" value={initMarbleformData.postcode || ''} onChange={handleFormChange} />
        </label>
        <label>
          owner:
          <input type="text" name="owner" value={initMarbleformData.owner || ''} onChange={handleFormChange} />
        </label>
        <label>
          address:
          <input type="text" name="address" value={initMarbleformData.address || ''} onChange={handleFormChange} />
        </label>
        <label>
          passport:
          <input type="text" name="passport" value={initMarbleformData.passport || ''} onChange={handleFormChange} />
        </label>
        <label>
          ni:
          <input type="text" name="ni" value={initMarbleformData.ni || ''} onChange={handleFormChange} />
        </label>
        <label>
          creditscore:
          <input type="text" name="creditscore" value={initMarbleformData.creditscore || ''} onChange={handleFormChange} />
        </label>

        {/* Add more input fields as needed */}
        <button type="submit">Submit</button>
      </form>
      {/* Display the response */}
      {initMarbleResponse && (
        <div>
          <p>Response: {initMarbleResponse}</p>
        </div>
      )}
/*------------------------------------------------------------------ */ 





<div>
    <div>
        <label htmlFor="deletemarbleName">Delete Marble Name:</label>
        <input
        type="text"
        id="deletemarbleName"
        value={marbleName}
        onChange={e => setdeletemarbleName(e.target.value)}
      />
    </div>           
      <button onClick={getdeleteMarble}>deleteMarble</button>
      <div>                
        {deleteMarbledata && (
        <div style={{ maxWidth: '500px', overflowWrap: 'break-word' }}>
          <p>Response: {deleteMarbledata}</p>
        </div>
      )}

     </div> 
 </div>

  /*------------------------------------------------------------------ */  

      </header>
    </div>
  );
}

export default App;
